import React from "react";
import './Kakao.css';
import { usekakaomap } from "./usekakaomap";

function Kakao() {
  const markerData = [
    {
      "stationChargerId": "PW013461-01",
      "name": "한국외국어대학교글로벌캠퍼스",
      "chargerType": "02",
      "address": "경기도 용인시 처인구 모현읍 외대로 81",
      "lat": 37.3377,
      "lng": 127.269,
      "operatorId": "PW",
      "operatorName": "파워큐브",
      "output": 7,
      "kindDetail": "J001",
      "updatedAt": "2024-02-13"
    },
    // 추가 데이터...
  ];

  usekakaomap(markerData);

  return (
    <div id="map" style={{ width: "100%", height: "100vh" }}></div>
  );
}

export default Kakao;
